export {
    ADD_USER,
    USER_LIST,
    LOGIN_TYPE
} from './types';

export const loginUserAs = (type) => {
    return (dispatch) => {
        dispatch(asyncLoginAs(type));
    }
}

export const asyncLoginAs = (type) => {
    return {
        type: LOGIN_TYPE,
        payload: type
    }
}

